@Injectable({
  providedIn: 'root'
})
export class SddiagnosticService {
  private apiUrl = 'https://localhost:7129/api/SDiagnostic/createSdiagnostics';

  constructor(private http: HttpClient) { }

  createSdiagnostic(sdiagnostic: any) {
      return this.http.post(this.apiUrl, sdiagnostic);
  }
 

